import { render } from "@testing-library/react";
import React from "react";
import Card from "./Card";

const Necas = ({ text }) => {
  console.log(text);
  return text.map((t) => {
    return <Card title={t.Title} />;
  });
};

Necas.defaultProps = {
  text: ["Sharknado"],
};

export default Necas;
